#include <fuzzer/FuzzedDataProvider.h>

#include <aconf.h>
#include <png.h>
#include <stddef.h>
#include <stdint.h>
#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <vector>

#include "GString.h"
#include "GlobalParams.h"
#include "PDFDoc.h"
#include "Splash.h"
#include "SplashBitmap.h"
#include "SplashOutputDev.h"
#include "config.h"
#include "gfile.h"
#include "parseargs.h"

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);
  double hdpi = fdp.ConsumeFloatingPoint<double>();
  double vdpi = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  bool useMediaBox = fdp.ConsumeBool();
  bool crop = fdp.ConsumeBool();
  bool printing = fdp.ConsumeBool();
  std::vector<char> payload = fdp.ConsumeRemainingBytes<char>();

  Object info, xfa;
  Object *acroForm;
  globalParams = new GlobalParams(NULL);
  globalParams->setErrQuiet(1);

  Object xpdf_obj;
  xpdf_obj.initNull();
  BaseStream *stream = new MemStream(payload.data(), 0, payload.size(), &xpdf_obj);

  PDFDoc *doc = NULL;
  try {
    doc = new PDFDoc(stream);
    if (doc->isOk() == gTrue) {
      int startPage = fdp.ConsumeIntegralInRange<int>(1, doc->getNumPages() + 1);
      int endPage = startPage + fdp.ConsumeIntegralInRange<int>(0, doc->getNumPages() - startPage + 1);

      SplashColor paperColor = {0xff, 0xff, 0xff};
      SplashOutputDev *splashOut = new SplashOutputDev(splashModeRGB8, 1, gFalse, paperColor);
      splashOut->setNoComposite(gTrue);
      splashOut->startDoc(doc->getXRef());

      // Call the displayPages method of PDFDoc object
      doc->displayPages(splashOut, startPage, endPage, hdpi, vdpi, rotate, useMediaBox, crop, printing, NULL, NULL);

      delete splashOut;
    }
  } catch (...) {
    delete doc;
  } 

  delete globalParams;

  return 0;
}
